import React, {Component} from 'react';
import './Hello.css';
import 'tachyons';

class Hello extends Component {
    render() {
        return (
        <div className='tc'>
        <h1>Hello World</h1>
        <p>Welcome to react</p>
        <p>{this.props.greeting}</p>
        <div className='tl'>
        <img src="" alt="Catherine Reed" />    
        <img src={require('locale.jpg')} />
        </div>
        </div>
        );
   }
}

export default Hello;
